            <a href="/text-to-image" className="nav-link">Imagine</a>
          </li>
          {/* <li className="nav-item">
            <a href="/improved-images" className="nav-link">Enhance</a>
          </li> */}
          
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
